  false,\n\t\"url\": null,\n\t\"notes\": \"A series of reports on coal resources of
  selected counties in Indiana were published as part of the Special Report series
  of the Indiana Geological Survey between 1985 and 1994. These reports included maps
  showing elevation of the Springfield Coal Member (Petersburg Formation, Pennsylvanian).
  The elevation maps were based on coal-test records and interpretations of geophysical
  logs that are included in the files of the Indiana Geological Survey. Data points
  were plotted by coal geologists of the Indiana Geological Survey and elevation contours
  were drawn by hand. The original work maps were compiled at a scale of 0.5 inch
  = 1 mile (1:126,720). Following completion of the investigations, the work maps
  showing elevation contours were subsequently scanned and digitized, and the resulting
  county coverages were then compiled into a single multi-county coverage. Elevations
  are given in feet, and the contour interval is 20 feet. Since the completion of
  this shapefile, additional data on coalbed elevations in selected areas has been
  obtained by the Indiana Geological Survey; interested users may wish to contact
  the Indiana Geological Survey for information on these more up-to-date sources.\",\n\t\"license_title\":
